import Head from 'next/head';
import React from 'react';
import Header from '../components/header';

const HomePage = () => {
	return (
		<>
			<Head>
				<title>
					I Create Software That Helps You Stand Out. | Strobe's Website
				</title>
			</Head>
			<body>
				<Header />
				<main>
					<div className="flex flex-col items-center text-center ">
						<p className="uppercase">Ryan Devoe</p>
						<h1 className="">
							I Create Software That Helps You <br />
							<span className="text-primary-color">Stand Out.</span>
						</h1>
					</div>
				</main>
			</body>
		</>
	);
};

export default HomePage;

export const getStaticProps = async () => {
	return {
		props: {},
	};
};
